const Hero = () => {
    return (
        <div>
            <div className="container-fluid"
                style={{
                    backgroundImage: 'url("/images/mainbg.png")', backgroundSize: 'cover', backgroundPosition: 'center', height: '100vh'
                }}>





                <div class="row h-50 items-center ms-lg-5">
                    <div class="col-lg-4 mt-5 text-lg-start text-center ms-lg-5">
                        <h1 class="display-1 fw-bold text-white ">
                            Hey I'm
                                <span class="animate-charcter">BUBUN</span>
                        </h1>
                        <p class="">A Passionate Web developer.....</p>
                    </div>
                </div>


                <div class="text-center">

                    <button onclick="window.location.href='#contact'" class="bttn fw-bold ps-5 pe-5 p-3 fs-5 rounded-3 border-0"
                        type="button">
                        Contact Me
                    </button>


                </div>











            </div>
        </div>
    );
}

export default Hero;
